import React, {useState} from 'react'

const userInfoStyle = {
    height: '100vh',
    border: "1px solid red",
    display: "flex",
    alignItems: "center",
    flexDirection: "column",
}

const userInfoIndividualDivStyle = {
    margin: "20px",
}

export default function UserInfo() {
    const [userInfo, setUserInfo] = useState({
        name:""
    });


    return (
        <div style={userInfoStyle}>
        <div style = {userInfoIndividualDivStyle}>
            Name: <input type="text" onChange={()=>setUserInfo({...userInfo, name:e.target.value})}/>
        </div>
        <div style = {userInfoIndividualDivStyle}>
            City: <input type="text" onChange={()=>setUserInfo({...userInfo, city:e.target.value})}/>
        </div>
        <div style = {userInfoIndividualDivStyle}>
            Pincode: <input type="text" onChange={()=>setUserInfo({...userInfo, pincode:e.target.value})}/>
        </div>
        <div style = {userInfoIndividualDivStyle}>
            Country: <input type="text" onChange={()=>setUserInfo({...userInfo, country:e.target.value})}/>
        </div>
        </div>
    );
}
